using BenchmarkDotNet.Attributes;
using BenchmarkDotNet.Order;
using IT.Security.Cryptography.JinnServer;
using IT.Security.Cryptography.JinnServer.Internal;
using IT.Security.Cryptography.Models;
using IT.Text;
using System.Text;

namespace IT.Benchmarks;

[MemoryDiagnoser]
[MinColumn, MaxColumn]
[Orderer(SummaryOrderPolicy.FastestToSlowest, MethodOrderPolicy.Declared)]
public class TagFinderBenchmark
{
    private readonly String _data;
    private readonly JinnServerService _jinnServerService = new JinnServerService(null, new TagFinder(), null);
    private readonly ValidationService _validationService = new(() => new ValidationOptions());

    public TagFinderBenchmark()
    {
        var base64 = "";
        _data = Encoding.UTF8.GetString(Convert.FromBase64String(base64));
    }

    [Benchmark]
    public Signatures NewEtalon()
    {
        var data = new Signatures {
            new Signature {
                Status = Security.Cryptography.Models.SignatureStatus.Valid,
                FirstTimeStamp = DateTime.Now,
                ValidationDate = DateTime.Now,
                Certificate = new Security.Cryptography.Models.Certificate
                {
                    Version="2",
                    ValidityFrom = DateTime.Now,
                    ValidityTo = DateTime.Now,
                    SubjectPublicKeyAlgorithm="SubjectPublicKeyAlgorithm",
                    SignatureAlg=""
                }
            }
        };
        data.DateTime = DateTime.Now;
        data.Status = SignaturesStatus.Valid;
        return data;
    }

    [Benchmark]
    public Signatures ParseEnvelope()
    {
        return _validationService.GetSignatures(_data);
    }

    [Benchmark]
    public Signatures ParseXMLEnvelope()
    {
        var d = _jinnServerService.ParseResponseValidation(_data);

        return xValidationResponseType.ToVerifySignatureResult(d);
    }
}